pragma solidity ^0.6.6;

import "./IUniswapV2Router02.sol";
import "./IApeRouter02.sol";
import "./IWETH.sol";
import "./Withdrawable.sol";
import { SafeMath } from "./Libraries.sol";
import { IERC20 } from "./Interfaces.sol";

contract ArbitrageContract is Ownable {
    using SafeMath for uint256;

    // If the directionNumber = 0, then the trade is going from sushi to ape. If directionNumber = 1, then from ape to sushi.
    struct TradeDirection{  
        uint directionNumber;
    }

    // IUniswapV2Router02 sushi_router = IUniswapV2Router02(0x1b02dA8Cb0d097eB8D57A175b88c7D8b47997506);
    // IApeRouter02 ape_router = IApeRouter02(0xC0788A3aD43d79aa53B09c2EaCc313A787d1d607);
    // IERC20 usdc = IERC20(0x2791Bca1f2de4661ED88A30C99A7a9449Aa84174);
    // IWETH wmatic = IWETH(0x0d500B1d8E8eF31E21C99d1Db9A6444d3ADf1270);
    IUniswapV2Router02 sushi_router;
    IApeRouter02 ape_router;
    IERC20 usdc;
    IWETH wmatic;
    TradeDirection public tradeDirection;
    address beneficiary;

    constructor(
        address sushiAddress,
        address apeAddress,
        address wmaticAddress,
        address usdcAddress,
        address beneficiaryAddress
    ) public {
        sushi_router = IUniswapV2Router02(sushiAddress);
        ape_router = IApeRouter02(apeAddress);
        wmatic = IWETH(wmaticAddress);
        usdc = IERC20(usdcAddress);
        beneficiary = beneficiaryAddress;
    }

    // Emit event after successful arbitrage
    event arbitrageFinished(
        uint tradeDirection,
        uint profit,
        uint date 
    );

    function Arbitrage(uint _direction) public payable onlyOwner {

    tradeDirection.directionNumber = _direction;
    uint256 usdcBalance = usdc.balanceOf(address(this));

    if (tradeDirection.directionNumber == 0){

            // USDC -> WMATIC on sushiswap
            usdc.approve(address(sushi_router), usdcBalance);
            address[] memory direction_sushi = new address[] (2);
            direction_sushi[0] = address(usdc);
            direction_sushi[1] = address(wmatic);
            // uint[] memory minOut_sushi = sushi_router.getAmountsOut(usdcBalance, direction_sushi);
            sushi_router.swapExactTokensForETH(usdcBalance, 0, direction_sushi, address(this), now);

            // WMATIC -> USDC on apeswap
            address[] memory direction_ape = new address[] (2);
            direction_ape[0] = address(wmatic);
            direction_ape[1] = address(usdc);
            uint[] memory minOut_ape = ape_router.getAmountsOut(address(this).balance, direction_ape);
            ape_router.swapExactETHForTokens {value: address(this).balance} (0, direction_ape, address(this), now);

            } else {

            // USDC -> WMATIC on apeswap
            usdc.approve(address(ape_router), usdcBalance);
            address[] memory direction_ape = new address[] (2);
            direction_ape[0] = address(usdc);
            direction_ape[1] = address(wmatic);
            // uint[] memory minOut_ape = ape_router.getAmountsOut(usdcBalance, direction_ape);
            ape_router.swapExactTokensForETH(usdcBalance, 0, direction_ape, address(this), now);


            // WMATIC -> USDC on sushiswap
            address[] memory direction_sushi = new address[] (2);
            direction_sushi[0] = address(wmatic);
            direction_sushi[1] = address(usdc);
            uint[] memory minOut_sushi = sushi_router.getAmountsOut(usdcBalance, direction_sushi);
            ape_router.swapExactETHForTokens{value: address(this).balance}(0, direction_sushi, address(this), now);
        }

            uint profit = usdc.balanceOf(address(this));
            usdc.transfer(beneficiary, profit);
            emit arbitrageFinished(tradeDirection.directionNumber, profit, now);
        }


    function withdrawToken(address _tokenContract, uint256 _amount) external onlyOwner {
    IERC20 tokenContract = IERC20(_tokenContract);
    tokenContract.transfer(msg.sender, _amount);
    }

    function withdrawAll(address _tokenAddress) external onlyOwner{
        IERC20 tokenContract = IERC20(_tokenAddress);
        uint256 totalBalance = tokenContract.balanceOf(address(this));
        tokenContract.transfer(msg.sender, totalBalance);
    }
}
